io多路复用
1.BIO
  服务端为每个socket建立一个链接，这样有多少socket就有多少线程。
  当并发超过100的时候，多线程已经捉襟见肘了。
  while (true) {
      socket = accept_socket();
      new Thread({
          handle_socket();
      }).start()
  }
2.NIO
  非阻塞的形式，添加到fds队列，然后while true循环遍历队列，如果有消息，则执行。
  while (true) {
      fds = add_socket();
      for (fd in fds) {
          if (fd.isReady()) {
              handle_socket();
          }
      }
  }
3.IO多路复用
  由系统内核处理，内核维护fds，当某个socket准备好的时候，添加到就绪列表，返回给epoll_wait，这样只需要在就绪列表遍历即可。
  while (true) {
      index = epoll_create(socket);
      epoll_ctl(index)
      socket = epoll_wait()
      handle_socket();
  }

